import React, { useState } from "react";
import axios from "axios";

const [message, setMessage] = useState('');

const handleDelete = async (name) => {
  try {
    const response = await axios.post('/delete/' + name, {
      name: name
    });
    setMessage(response.data);
  } catch (error) {
    console.error(error);
  }
 };
